PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "schema_migrations" ("version" varchar NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "hosts" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "datacenter_id" integer NOT NULL, "ram" integer, "storage" integer, "bandwidth" integer, "pe_count" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, CONSTRAINT "fk_rails_c432e34aa7"
FOREIGN KEY ("datacenter_id")
  REFERENCES "datacenters" ("id")
);
CREATE TABLE IF NOT EXISTS "vms" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "datacenter_id" integer NOT NULL, "mips" integer, "ram" integer, "storage" integer, "bandwidth" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, CONSTRAINT "fk_rails_da0bdebb3d"
FOREIGN KEY ("datacenter_id")
  REFERENCES "datacenters" ("id")
);
CREATE TABLE IF NOT EXISTS "datacenters" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "num_hosts" integer DEFAULT 1, "pe_mips" integer DEFAULT 1000, "ram" integer DEFAULT 8192, "storage" integer DEFAULT 1000000, "bandwidth" integer DEFAULT 10000, "scheduling_policy" varchar DEFAULT 'TimeShared', "power_model" varchar DEFAULT 'PowerAware', "latency" integer DEFAULT 10, "topology" varchar DEFAULT 'Mesh', "bandwidth_policy" varchar DEFAULT 'Best Effort', "storage_type" varchar DEFAULT 'SSD', "cpu_cost" float DEFAULT 0.05, "ram_cost" float DEFAULT 0.01, "storage_cost" float DEFAULT 0.001, "bw_cost" float DEFAULT 0.005, "power_usage" float DEFAULT 200.0, "idle_power" float DEFAULT 50.0, "autoscaling" boolean DEFAULT 0, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "instance_types" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "cpus" integer, "memoryInMB" integer, "pricePerHour" decimal, "region" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "cloudlets" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "length" integer, "file_size" integer, "output_size" integer, "workload_type" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "simulation_results" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "datacenter_id" integer, "datacenter_name" varchar, "datacenter_cpu_cost" float, "datacenter_ram_cost" float, "datacenter_storage_cost" float, "datacenter_bw_cost" float, "host_id" integer, "host_cpu_cores" integer, "host_ram" integer, "host_storage" integer, "host_bw" integer, "host_mips" float, "vm_id" integer, "vm_cpu_cores" integer, "vm_ram" integer, "vm_storage" integer, "vm_bw" integer, "vm_mips" float, "cloudlet_id" integer, "cloudlet_length" integer, "cloudlet_pes" integer, "cloudlet_file_size" integer, "cloudlet_output_size" integer, "execution_time" float, "cpu_utilization" float, "ram_utilization" float, "bw_utilization" float, "storage_utilization" float, "execution_time_breach" boolean, "cpu_breach" boolean, "ram_breach" boolean, "bw_breach" boolean, "cost" float, "sla_breach_cost" float, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "compare_algos" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "cloudlet_id" integer, "algo" varchar, "algo_eff_time" decimal, "min_cost" decimal, "min_executn_time" decimal, "instance_type_id" integer, "datacenter_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
DELETE FROM sqlite_sequence;
CREATE INDEX "index_hosts_on_datacenter_id" ON "hosts" ("datacenter_id");
CREATE INDEX "index_vms_on_datacenter_id" ON "vms" ("datacenter_id");
COMMIT;
